import styled from 'styled-components';

const Sidebar = styled.div`
  background-color: #fff;
  grid-area: sidebar;
  border-bottom-left-radius: 8px;
  border-top-left-radius: 8px;

  z-index: 5;
`;

export default Sidebar;
